  data. rnrnData sources: NYC Department of Health and Mental Hygiene (DOHMH), Division
  of Environmental Health Pest Control DatabasernrnNotes on data limitations: Please
  note that if a property/taxlot does not appear in the file, that does not indicate
  an absence of rats - rather just that it has not been inspected. Similarly, neighborhoods
